import React from 'react';
import { Button, Form, FormControl, col, Jumbotron, Container } from 'react-bootstrap';

export default function Login() {
    return (
        <Jumbotron fluid>
            <Container className="boxLogin">
                <InputGroup className="mb-3">
                    <Navbar bgh="ligth" expand="lg" className="navBar shadow">
                        
                    </Navbar>
                </InputGroup>
            </Container>
        </Jumbotron>
    );
}
